import React from 'react';
import classes from './Menu.module.css';
import { Link } from 'react-router-dom';

const Menu = (props) => {
    return (
        <div className={classes.Menustyle}>
            <ul className={classes.ul}>
                <li className={classes.li}> <Link className={classes.links} to="/"> HOME </Link> </li>
                <li className={classes.li}> <Link className={classes.links} to="/login"> {props.logstatus} </Link> </li>
                <li className={classes.li}> <Link className={classes.links} to="/signup"> {props.signstatus} </Link> </li>
                <li className={classes.li}> <Link className={classes.links} to="/addidea">ADD-IDEA </Link></li>
            </ul>
        </div>
    )
}

export default Menu;
